INSERT INTO `catalog_product_entity_text` VALUES (1,4,72,0,1,'<p><span>Product Description</span><br /><span>In the early part of the twentieth century doctors began to insist iodine be added to table salt because of its absence in the American diet. Fast forward to another century and Doctors throughout the Country have again raised the alarm about an almost universal Iodine deficiency in their patients.</span><br /><br /><span>Researchers are now realizing the strain this is putting on our bodies. There is a growing segment of the medical community educating their patients to what proper Iodine nutrition will do; including thyroid health, overall brain function and even treating Fibromyalgia. The nascent type formula in Power Iodine is exceptionally made to ensure your body can utilize the superior Iodine to its maximum benefit.</span><br /><br /><span>Traditionally Iodine has been valued to purify water, clean and heal wounds and help prevent radiation damage to your thyroid. Power Iodine from NuManna can be used in all these applications as well as enhancing your overall Iodine levels and thyroid function. Radioactive isotopes seem to settle in the thyroid. During a nuclear event the Cesium isotopes will follow the path of least resistance to an under-nourished thyroid. This is how radiation damages sensitive organs. A thyroid with proper levels of Iodine creates a barrier to radioactive isotopes looking for a home in the body.</span><br /><br /><span>Whether you want to protect your family, store Iodine to purify water and heal wounds or give the body proper Iodine levels Power Iodine is a great product to store.</span><br /><br /><span>Here is just a couple of comments from some of our happy customers: Liz H. from Wisconsin; &ldquo;When my blood work showed I was low in Iodine I looked for a good supplement. The nascent formula in Power Iodine has been great for me. I take it everyday.&rdquo; Julie G. from Utah; &ldquo;I was surprised how it helped my overall mood and ability to think. I definitely don&rsquo;t want to be without my Iodine.&rdquo;</span><br /><br /><span>* Consult your doctor before taking Power Iodine.</span></p>'),(2,4,83,0,1,''),(3,4,73,0,1,'Iodine deficiency is rapidly becoming a national concern. Plant-derived, gently processed Iodine is harvested and charged creating a special Nascent Iodine. The Nascent Iodine is then suspended in GMO-Free solution which is highly absorbable and easy for your body to get where it needs to in your body. Absolutely one of the best forms of Iodine supplementation on the market.'),(4,4,72,0,2,'<p>Easily store 6 packs (40 servings each) of high-quality, hormone-free milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years.</p>\r\n<ul>\r\n<li>Each bag is over 2 lbs, with a re-sealable top to prevent spoilage.</li>\r\n<li>Easy to prepare: just mix with fresh water and stir.</li>\r\n<li>Superior taste: just like store-bought milk you may be using now.</li>\r\n<li>Hormone free, certified organic, and meets the highest USDA standards.</li>\r\n</ul>\r\n'),(5,4,83,0,2,''),(6,4,73,0,2,'<p>Easily store 6 packs (40 servings each) of high-quality, hormone-free milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years.</p>\r\n<ul>\r\n<li>Each bag is over 2 lbs, with a re-sealable top to prevent spoilage.</li>\r\n<li>Easy to prepare: just mix with fresh water and stir.</li>\r\n<li>Superior taste: just like store-bought milk you may be using now.</li>\r\n<li>Hormone free, certified organic, and meets the highest USDA standards.</li>\r\n</ul>'),(7,4,72,0,3,'<p>Easily store 40 servings of non-fat, high-quality, hormone-free milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years.</p>\r\n<p>&bull; Each bag is over 2 lbs, with a re-sealable top to prevent spoilage.</p>\r\n<p>&bull; Easy to prepare: just mix with fresh water and stir.</p>\r\n<p>&bull; Superior taste: just like store-bought milk you may be using now.</p>\r\n<p>&bull; Hormone free, certified organic, and meets the highest USDA standards.</p>'),(8,4,83,0,3,''),(9,4,73,0,3,'We have made it very easy to store and use a high quality milk product as part of your long term storage. Each bag is over 2 lbs of milk powder with a resealable top for convenience and to prevent spoilage. Preparation is simple—choose the amount of powder to the desired amount of water, stir vigorously and the milk mixes rather easily and tastes surprisingly like store bought milk you may be using now. In fact, it may be even better, because NuManna milk packs are all HORMONE-FREE and of the highest USDA standards.'),(10,4,72,0,4,'In our pursuit of superior products NuManna has always been ahead of the curve in our industry. Our new Organic Milk Powder is just another example of what we are all about. We focus on manufacturing the best products for our family so you will never regret having NuManna to serve to yours. NuManna is now the first food storage company to offer organic milk powder. Also, all our milk receives our proprietary bio-enhancement treatment and packaged correctly for long term storage before it is labeled NuManna Best.'),(11,4,83,0,4,''),(12,4,73,0,4,'We have made it very easy to store and use a high quality milk product as part of your long term storage. Each bag is over 2 lbs of milk powder with a resealable top for convenience and to prevent spoilage. Preparation is simple—choose the amount of powder to the desired amount of water, stir vigorously and the milk mixes rather easily and tastes surprisingly like store bought milk you may be using now. In fact, it may be even better, because NuManna milk packs are all HORMONE-FREE and of the highest USDA standards. And now, for the first time, you can buy Organic Milk Powder from a long-term storage company.'),(13,4,72,0,5,'<p>Easily store high-quality milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years.</p>\r\n<ul>\r\n<li>Each bag is over 2 lbs, with a resealable top to prevent spoilage.</li>\r\n<li>Easy to prepare: just mix with fresh water and stir.</li>\r\n<li>Superior taste: just like store-bought milk you may be using now.</li>\r\n<li>Hormone free, certified organic, and meets the highest USDA standards.</li>\r\n</ul>'),(14,4,83,0,5,''),(15,4,73,0,5,'<p>Easily store high-quality milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years.</p>\r\n<ul>\r\n<li>Each bag is over 2 lbs, with a resealable top to prevent spoilage.</li>\r\n<li>Easy to prepare: just mix with fresh water and stir.</li>\r\n<li>Superior taste: just like store-bought milk you may be using now.</li>\r\n<li>Hormone free, certified organic, and meets the highest USDA standards.</li>\r\n</ul>'),(16,4,72,0,6,'<p>The DuraFlo&trade; water-filter replacement works with any candlestick-style water filter, such as Katadyn&reg;, Aqua Pur&reg;, Doulton&reg;, Berkey&reg;, and many other brands of water filters.</p>\r\n<ul>\r\n<li>Deactivates 99.99% of harmful bacteria, virus, cysts, and microbes such as Cryptosporidium and Giardia.</li>\r\n<li>Removes heavy metals, even from the most contaminated sources.</li>\r\n<li>Removes hydrocarbons, fluoride, chlorine and other toxic substances</li>\r\n<li>Can be used and then stored for long periods. Simply rinse and dry to store.</li>\r\n</ul>\r\n<p>The DuraFlo&trade; Water Filter Replacement has been independently lab tested and certified to calibrate its useful filtration life. You can check the indicator light on your filtration system to know exactly when to replace your DuraFlo. It works with any candlestick style water filters, such as Katadyn&reg;, Aqua Pur&reg;, Doulton&reg; and the Berkey&reg; water filter.</p>'),(17,4,83,0,6,''),(18,4,73,0,6,'Treats 550 gallons. The DuraFlo™ Water Filter - used in the AquaBrick™ Water Filtration System - is setting the new standard in water filtration. The DuraFlo™ has been tested and certified by independent water laboratories to remove virus, bacteria, giardia and 118 other water borne toxins and chemicals, providing purified water from any non-salt water source.'),(19,4,72,0,7,'<p>The human body will die within 2-3 days without clean drinking water. Be prepared. Our AquaPail&trade; water-filtration system removes or deactivates virtually all harmful substances from any non-saline water source. Our proprietary filtration offers many advantages in a crisis:</p>\r\n<ul>\r\n<li>Works within minutes, not hours.</li>\r\n<li>Deactivates harmful bacteria, virus, cysts, and microbes such as Cryptosporidium and Giardia.</li>\r\n<li>Removes heavy metals, even from the most contaminated sources.</li>\r\n<li>Removes hydrocarbons, fluoride, chlorine and other toxic substances</li>\r\n</ul>'),(20,4,83,0,7,''),(21,4,73,0,7,'<p>The human body will die within 2-3 days without clean drinking water. Be prepared. Our AquaPail&trade; water-filtration system removes or deactivates virtually all harmful substances from any non-saline water source. Our proprietary filtration offers many advantages in a crisis:</p>\r\n<ul>\r\n<li>Works within minutes, not hours.</li>\r\n<li>Deactivates harmful bacteria, virus, cysts, and microbes such as Cryptosporidium and Giardia.</li>\r\n<li>Removes heavy metals, even from the most contaminated sources.</li>\r\n<li>Removes hydrocarbons, fluoride, chlorine and other toxic substances</li>\r\n</ul>'),(22,4,72,0,8,'<p>The human body will die within 2-3 days without clean drinking water. Be prepared. Our AquaPail&trade; water-filtration system removes or deactivates virtually all harmful substances from any non-saline water source. Our proprietary filtration offers many advantages in a crisis:</p>\r\n<ul>\r\n<li>Works within minutes, not hours.</li>\r\n<li>Deactivates harmful bacteria, virus, cysts, and microbes such as Cryptosporidium and Giardia.</li>\r\n<li>Removes heavy metals, even from the most contaminated sources.</li>\r\n<li>Removes hydrocarbons, fluoride, chlorine and other toxic substances</li>\r\n</ul>'),(23,4,83,0,8,''),(24,4,73,0,8,'<p>The human body will die within 2-3 days without clean drinking water. Be prepared. Our AquaPail&trade; water-filtration system removes or deactivates virtually all harmful substances from any non-saline water source. Our proprietary filtration offers many advantages in a crisis:</p>\r\n<ul>\r\n<li>Works within minutes, not hours.</li>\r\n<li>Deactivates harmful bacteria, virus, cysts, and microbes such as Cryptosporidium and Giardia.</li>\r\n<li>Removes heavy metals, even from the most contaminated sources.</li>\r\n<li>Removes hydrocarbons, fluoride, chlorine and other toxic substances</li>\r\n</ul>'),(25,4,72,0,9,'\r\n.datagridTable table { border-collapse: collapse; text-align: left; width: 100%; } .datagridTable {font: normal 12px/150% Arial, Helvetica, sans-serif; background: #fff; overflow: hidden; border: 1px solid #999999; -webkit-border-radius: 3px; -moz-border-radius: 3px; border-radius: 3px; }.datagridTable table td, .datagridTable table th { padding: 8px 16px; }.datagridTable table thead th {background:-webkit-gradient( linear, left top, left bottom, color-stop(0.05, #999999), color-stop(1, #999999) );background:-moz-linear-gradient( center top, #999999 5%, #999999 100% );filter:progid:DXImageTransform.Microsoft.gradient(startColorstr=\'#999999\', endColorstr=\'#999999\');background-color:#999999; color:#FFFFFF; font-size: 15px; font-weight: bold; border-left: 1px solid #A8A8A8; } .datagridTable table thead th:first-child { border: none; }.datagridTable table tbody td { color: #666666; border-left: 1px solid #E1EEF4;font-size: 12px;font-weight: normal; }.datagridTable table tbody .alt td { background: #EDEDED; color: #666666; }.datagridTable table tbody td:first-child { border-left: none; }.datagridTable table tbody tr:last-child td { border-bottom: none; }\r\n\r\n\r\nAquaPail, is the Worlds ONLY, Emergency Gravity Fed Water Filter with END OF LIFE testing!!\r\n&nbsp;\r\n\r\nAquapails come in 3 sizes:\r\n\r\nSmallMediumLarge\r\n\r\n\r\n1,100 Gallons.\r\nEquivalent of 1 person\'s total water needs for 1 year.\r\n3,300 Gallons.\r\nEquivalent of 3 people\'s total water needs for 1 year.\r\n5,500 Gallons.\r\nEquivalent of 5 people\'s total water needs for 1 year.\r\n\r\n\r\n\r\nTested and Certified to Establish the Water Filter’s “End of Life”\r\n\r\nRemoves virus, bacteria, giardia from any water source. Imagine how good your tap water will taste.\r\n\r\nThe DuraFlo™ Water Filter used in the AquaPail water filter has been tested and certified by independent laboratories to establish the water filter’s “End of Life”. The water filter will safely filter out 99.99% of virus for up to 550 gallons; and safely filter out 99.9999% bacteria and 99.99% of giardia and cryptosporidium for up to 700 gallons from highly contaminated water. The AquaPail™ is perfect for emergency preparedness, outdoor adventure and humanitarian aid.\r\nNeeds no power to operate.\r\nGravity is all it takes for the water to flow through the filter and easily dispense through the spout. It’s great to have your purified water on hand, in case of emergency and also be able to filter water when you need it. The AquaPail™ Water Filters are  perfect for emergency preparedness, camping, boating, hunting and all outdoor activities.\r\n\r\n&nbsp;\r\n\r\n'),(26,4,83,0,9,''),(27,4,73,0,9,'The New Standard in Water Filtration\r\nWhile most water filtration systems on the market only remove certain dangerous elements from your drinking water, the AquaPail™ Water Filtration System will remove or deactivate virtually all harmful substances from any non-salt water source. Within a matter of minutes, the AquaPail™ water filter will deliver safe drinking water by deactivating harmful bacteria, virus, cysts, such as cryptosporidium and giardia, and removing heavy metals. Using our proprietary filtration method the filter literally deactivates and removes waterborne microbes from even the most contaminated water source. The AquaPail™ water filter removes hydrocarbons, fluoride, chlorine and other harmful substances providing clean, purified drinking water for you and your family.'),(28,4,72,0,10,'\r\n.datagridTable table { border-collapse: collapse; text-align: left; width: 100%; } .datagridTable {font: normal 12px/150% Arial, Helvetica, sans-serif; background: #fff; overflow: hidden; border: 1px solid #999999; -webkit-border-radius: 3px; -moz-border-radius: 3px; border-radius: 3px; }.datagridTable table td, .datagridTable table th { padding: 8px 16px; }.datagridTable table thead th {background:-webkit-gradient( linear, left top, left bottom, color-stop(0.05, #999999), color-stop(1, #999999) );background:-moz-linear-gradient( center top, #999999 5%, #999999 100% );filter:progid:DXImageTransform.Microsoft.gradient(startColorstr=\'#999999\', endColorstr=\'#999999\');background-color:#999999; color:#FFFFFF; font-size: 15px; font-weight: bold; border-left: 1px solid #A8A8A8; } .datagridTable table thead th:first-child { border: none; }.datagridTable table tbody td { color: #666666; border-left: 1px solid #E1EEF4;font-size: 12px;font-weight: normal; }.datagridTable table tbody .alt td { background: #EDEDED; color: #666666; }.datagridTable table tbody td:first-child { border-left: none; }.datagridTable table tbody tr:last-child td { border-bottom: none; }\r\n\r\n\r\nAquaPail, is the Worlds ONLY, Emergency Gravity Fed Water Filter with END OF LIFE testing!!\r\n&nbsp;\r\n\r\nAquapails come in 3 sizes:\r\n\r\nSmallMediumLarge\r\n\r\n\r\n1,100 Gallons.\r\nEquivalent of 1 person\'s total water needs for 1 year.\r\n3,300 Gallons.\r\nEquivalent of 3 people\'s total water needs for 1 year.\r\n5,500 Gallons.\r\nEquivalent of 5 people\'s total water needs for 1 year.\r\n\r\n\r\n\r\nTested and Certified to Establish the Water Filter’s “End of Life”\r\n\r\nRemoves virus, bacteria, giardia from any water source. Imagine how good your tap water will taste.\r\n\r\nThe DuraFlo™ Water Filter used in the AquaPail water filter has been tested and certified by independent laboratories to establish the water filter’s “End of Life”. The water filter will safely filter out 99.99% of virus for up to 550 gallons; and safely filter out 99.9999% bacteria and 99.99% of giardia and cryptosporidium for up to 700 gallons from highly contaminated water. The AquaPail™ is perfect for emergency preparedness, outdoor adventure and humanitarian aid.\r\nNeeds no power to operate.\r\nGravity is all it takes for the water to flow through the filter and easily dispense through the spout. It’s great to have your purified water on hand, in case of emergency and also be able to filter water when you need it. The AquaPail™ Water Filters are  perfect for emergency preparedness, camping, boating, hunting and all outdoor activities.\r\n\r\n&nbsp;\r\n\r\n'),(29,4,83,0,10,''),(30,4,73,0,10,'The New Standard in Water Filtration\r\nWhile most water filtration systems on the market only remove certain dangerous elements from your drinking water, the AquaPail™ Water Filtration System will remove or deactivate virtually all harmful substances from any non-salt water source. Within a matter of minutes, the AquaPail™ water filter will deliver safe drinking water by deactivating harmful bacteria, virus, cysts, such as cryptosporidium and giardia, and removing heavy metals. Using our proprietary filtration method the filter literally deactivates and removes waterborne microbes from even the most contaminated water source. The AquaPail™ water filter removes hydrocarbons, fluoride, chlorine and other harmful substances providing clean, purified drinking water for you and your family.'),(31,4,72,0,11,'Features of the Propur™ PMC-3000 Countertop System:\r\n\r\n 	Single stage design\r\n 	Premium quality housing and fittings\r\n 	Full 3/8\" PVC tubing\r\n 	Includes one ProMax™ filter element\r\n 	Enjoy Propurified™ water when you want it\r\n 	Designed to fit most faucets with removable aerator\r\n 	Optional adapter available for most other faucet types\r\n 	ABS plastic housing - BPA &amp; BPS free\r\n 	No power required\r\n 	Easy to replace filter element\r\n 	Includes a diverter valve allowing you to switch between filtered and direct faucet water\r\n 	Overall size is 4.75\" x 4.75\" x 12.5\"\r\n\r\nPropur™ Countertop System with ProMax™ Specifications\r\n\r\nType of installation: Countertop\r\nMaximum Working Pressure: 689.5 Kpa (100 psig)\r\nMinimum Working Pressure: 124 Kpa (20 psig)\r\nMaximum Working Temperature: 38° C (100° F)\r\nMinimum Working Temperature: 5° C (41° F)\r\nRecommended Flow Rate: 0.2 – 1.0 gpm\r\nContaminant Reduction: Refer to Lab Report\r\nFilter Life Expectancy: Up to 1 year\r\nReplacement filter: PMC34RF'),(32,4,83,0,11,''),(33,4,73,0,11,'New Propur™ Countertop Water Filter System with ProMax™ Filter Technology is designed to fit most standard faucets with a removable aerator. Installs in just minutes without any tools.  Enjoy Propurified™ water by just turning on your faucet and diverter valve. With ProMax™ Filter Technology, reduce/remove a broad range of over 200 contaminants including VOC’s, lead, fluoride, heavy metals, pesticides, SVC’s, disinfectants, inorganic non-metallics, herbicides, pharmaceuticals, PFOA, PFOS and micro-organisms. Tested to NSF-42, 53 and P231 standards. See ProMax™ Lab Report for details.'),(34,4,72,0,12,''),(35,4,83,0,12,''),(36,4,73,0,12,'Introducing new ProMaxTM high efficiency, encapsulated, multi-stage water filter technology from PropurTM. \r\n\r\nEach stage is comprised of a unique proprietary formula of infused microstructure filtration media designed to target a specific group of contaminants. Contains no resins or beads. Engineered for unsurpassed performance and maximum contaminant reduction.\r\n\r\nIndependent lab reports show the ProMaxTM reduces/removes a broad range of 200 + contaminants including VOC’s, lead, fluoride, heavy metals, pesticides, SVC’s, disinfectants, inorganic non-metallics, herbicides, pharmaceuticals, PFOA, PFOS and micro-organisms. Helps improve taste and odor. Tested to NSF-42, 53 and P231 standards. See ProMaxTM Lab Reports for details. Unlike carbon block and ceramic composite filters, ProMaxTM filters do not require cleaning to help maintain flow rate and contaminant reduction.\r\n\r\nProMaxTM filter technology is available on select PropurTM products including PropurTM Shower Filter, Countertop and In-line for the refrigerator.'),(37,4,72,0,13,''),(38,4,83,0,13,''),(39,4,73,0,13,''),(42,4,106,0,1,NULL),(45,4,106,0,2,NULL),(47,4,106,0,3,NULL),(56,4,106,0,5,NULL),(59,4,106,0,6,NULL),(61,4,106,0,7,NULL),(64,4,106,0,8,NULL),(67,4,72,0,14,'Nulla rhoncus lacus id accumsan tincidunt. Fusce at urna tellus. Phasellus dignissim posuere accumsan. Phasellus sit amet elementum tortor. Maecenas congue eros eu dui posuere, quis imperdiet velit tempor. Curabitur rhoncus enim et arcu dapibus facilisis. Aenean odio felis, imperdiet quis felis ut