INSERT INTO `catalogsearch_fulltext` VALUES (66,12,1,'None|Replacement ProMax™ Countertop Filter||Introducing new ProMaxTM high efficiency, encapsulated, multi-stage water filter technology from PropurTM. Each stage is comprised of a unique proprietary formula of infused microstructure filtration media designed to target a specific group of contaminants. Contains no resins or beads. Engineered for unsurpassed performance and maximum contaminant reduction. Independent lab reports show the ProMaxTM reduces/removes a broad range of 200 + contaminants including VOC’s, lead, fluoride, heavy metals, pesticides, SVC’s, disinfectants, inorganic non-metallics, herbicides, pharmaceuticals, PFOA, PFOS and micro-organisms. Helps improve taste and odor. Tested to NSF-42, 53 and P231 standards. See ProMaxTM Lab Reports for details. Unlike carbon block and ceramic composite filters, ProMaxTM filters do not require cleaning to help maintain flow rate and contaminant reduction. ProMaxTM filter technology is available on select PropurTM products including PropurTM Shower Filter, Countertop and In-line for the refrigerator.|79.95|1'),(67,13,1,'None|Universal Faucet Adapter for Propur Countertop System|||6.95|1'),(68,14,1,'SAMPLE-PACK|NuManna|None|Sample Pack|Nulla rhoncus lacus id accumsan tincidunt. Fusce at urna tellus. Phasellus dignissim posuere accumsan. Phasellus sit amet elementum tortor. Maecenas congue eros eu dui posuere, quis imperdiet velit tempor. Curabitur rhoncus enim et arcu dapibus facilisis. Aenean odio felis, imperdiet quis felis ut, euismod elementum purus. Maecenas nec ultrices enim, sit amet vestibulum lacus. Vivamus neque lacus, malesuada at porttitor in, iaculis eget mauris. Quisque velit enim, sagittis eu diam vel, vehicula dictum risus. Suspendisse ullamcorper eleifend laoreet. Phasellus placerat vitae massa sed scelerisque. Vivamus aliquam ligula quis dui ultrices viverra. Fusce cursus quam at ligula interdum, in tempor erat rhoncus.|Nulla rhoncus lacus id accumsan tincidunt. Fusce at urna tellus. Phasellus dignissim posuere accumsan. Phasellus sit amet elementum tortor. Maecenas congue eros eu dui posuere, quis imperdiet velit tempor. Curabitur rhoncus enim et arcu dapibus facilisis. Aenean odio felis, imperdiet quis felis ut, euismod elementum purus. Maecenas nec ultrices enim, sit amet vestibulum lacus. Vivamus neque lacus, malesuada at porttitor in, iaculis eget mauris. Quisque velit enim, sagittis eu diam vel, vehicula dictum risus. Suspendisse ullamcorper eleifend laoreet. Phasellus placerat vitae massa sed scelerisque. Vivamus aliquam ligula quis dui ultrices viverra. Fusce cursus quam at ligula interdum, in tempor erat rhoncus.|19.95|1'),(65,11,1,'None|Propur™ Countertop System w/ ProMax™|Features of the Propur™ PMC-3000 Countertop System: Single stage design Premium quality housing and fittings Full 3/8\" PVC tubing Includes one ProMax™ filter element Enjoy Propurified™ water when you want it Designed to fit most faucets with removable aerator Optional adapter available for most other faucet types ABS plastic housing - BPA &amp; BPS free No power required Easy to replace filter element Includes a diverter valve allowing you to switch between filtered and direct faucet water Overall size is 4.75\" x 4.75\" x 12.5\" Propur™ Countertop System with ProMax™ Specifications Type of installation: Countertop Maximum Working Pressure: 689.5 Kpa (100 psig) Minimum Working Pressure: 124 Kpa (20 psig) Maximum Working Temperature: 38° C (100° F) Minimum Working Temperature: 5° C (41° F) Recommended Flow Rate: 0.2 – 1.0 gpm Contaminant Reduction: Refer to Lab Report Filter Life Expectancy: Up to 1 year Replacement filter: PMC34RF|New Propur™ Countertop Water Filter System with ProMax™ Filter Technology is designed to fit most standard faucets with a removable aerator. Installs in just minutes without any tools. Enjoy Propurified™ water by just turning on your faucet and diverter valve. With ProMax™ Filter Technology, reduce/remove a broad range of over 200 contaminants including VOC’s, lead, fluoride, heavy metals, pesticides, SVC’s, disinfectants, inorganic non-metallics, herbicides, pharmaceuticals, PFOA, PFOS and micro-organisms. Tested to NSF-42, 53 and P231 standards. See ProMax™ Lab Report for details.|189|1'),(58,1,1,'power_iodine|Standard Rates|Power Iodine|Product DescriptionIn the early part of the twentieth century doctors began to insist iodine be added to table salt because of its absence in the American diet. Fast forward to another century and Doctors throughout the Country have again raised the alarm about an almost universal Iodine deficiency in their patients.Researchers are now realizing the strain this is putting on our bodies. There is a growing segment of the medical community educating their patients to what proper Iodine nutrition will do; including thyroid health, overall brain function and even treating Fibromyalgia. The nascent type formula in Power Iodine is exceptionally made to ensure your body can utilize the superior Iodine to its maximum benefit.Traditionally Iodine has been valued to purify water, clean and heal wounds and help prevent radiation damage to your thyroid. Power Iodine from NuManna can be used in all these applications as well as enhancing your overall Iodine levels and thyroid function. Radioactive isotopes seem to settle in the thyroid. During a nuclear event the Cesium isotopes will follow the path of least resistance to an under-nourished thyroid. This is how radiation damages sensitive organs. A thyroid with proper levels of Iodine creates a barrier to radioactive isotopes looking for a home in the body.Whether you want to protect your family, store Iodine to purify water and heal wounds or give the body proper Iodine levels Power Iodine is a great product to store.Here is just a couple of comments from some of our happy customers: Liz H. from Wisconsin; &ldquo;When my blood work showed I was low in Iodine I looked for a good supplement. The nascent formula in Power Iodine has been great for me. I take it everyday.&rdquo; Julie G. from Utah; &ldquo;I was surprised how it helped my overall mood and ability to think. I definitely don&rsquo;t want to be without my Iodine.&rdquo;* Consult your doctor before taking Power Iodine.|Iodine deficiency is rapidly becoming a national concern. Plant-derived, gently processed Iodine is harvested and charged creating a special Nascent Iodine. The Nascent Iodine is then suspended in GMO-Free solution which is highly absorbable and easy for your body to get where it needs to in your body. Absolutely one of the best forms of Iodine supplementation on the market.|31.95|1'),(59,2,1,'6pack-milk|Standard Rates|6 Pack of Hormone-Free USDA Non-Fat Milk Powder 40 Serving Pouch|Easily store 6 packs (40 servings each) of high-quality, hormone-free milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years. Each bag is over 2 lbs, with a re-sealable top to prevent spoilage. Easy to prepare: just mix with fresh water and stir. Superior taste: just like store-bought milk you may be using now. Hormone free, certified organic, and meets the highest USDA standards.|Easily store 6 packs (40 servings each) of high-quality, hormone-free milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years. Each bag is over 2 lbs, with a re-sealable top to prevent spoilage. Easy to prepare: just mix with fresh water and stir. Superior taste: just like store-bought milk you may be using now. Hormone free, certified organic, and meets the highest USDA standards.|105.75|1'),(60,3,1,'sku25|Standard Rates|Hormone-Free USDA Non-Fat Milk Powder 40 Serving Pouch|Easily store 40 servings of non-fat, high-quality, hormone-free milk as part of your long-term preparedness strategy. NuManna is the first food-preparedness company to offer hormone free, organic milk powder. Our milk receives our proprietary bio-enhancement treatment and is hermetically sealed to ensure successful long-term storage of 10-15 years. &bull; Each bag is over 2 lbs, with a re-sealable top to prevent spoilage. &bull; Easy to prepare: just mix with fresh water and stir. &bull; Superior taste: just like store-bought milk you may be using now. &bull; Hormone free, certified organic, and meets the highest USDA standards.|We have made it very easy to store and use a high quality milk product as part of your long term storage. Each bag is over 2 lbs of milk powder with a resealable top for convenience and to prevent spoilage. Preparation is simple—choose the amount of powder to the desired amount of water, stir vigorously and the milk mixes rather easily and tastes surprisingly like store bought milk you may be using now. In fact, it may be even better, because NuManna milk packs are all HORMONE-FREE and of the highest USDA standards.|21.75|1'),(61,4,1,'milk1|Standard Rates|Premium Organic Milk Powder 40 Serving Pouch|In our pursuit of superior products NuManna has always been ahead of the curve in our industry. Our new Organic Milk Powder is just another example of what we are all about. We focus on manufacturing the best products for our family so you will never regret having NuManna to serve to yours. NuManna is now the first food storage company to offer organic milk powder. Also, all our milk receives our proprietary bio-enhancement treatment and packaged correctly for long term storage before it is labeled NuManna Best.|We have made it very easy to store and use a high quality milk product as part of your long term storage. Each bag is over 2 lbs