INSERT INTO `cms_page` VALUES (1,'404 Not Found','one_column','Page keywords','Page description','no-route',NULL,'<div class=\"page-title\">\r\n<h1>Whoops, our bad...</h1>\r\n</div>\r\n<dl><dt>The page you requested was not found, and we have a fine guess why.</dt><dd>\r\n<ul class=\"disc\">\r\n<li>If you typed the URL directly, please make sure the spelling is correct.</li>\r\n<li>If you clicked on a link to get here, the link is outdated.</li>\r\n</ul>\r\n</dd></dl><dl><dt>What can you do?</dt><dd>Have no fear, help is near! There are many ways you can get back on track with Magento Store.</dd><dd>\r\n<ul class=\"disc\">\r\n<li><a onclick=\"history.go(-1); return false;\" href=\"#\">Go back</a> to the previous page.</li>\r\n<li>Use the search bar at the top of the page to search for your products.</li>\r\n<li>Follow these links to get you back on track!<br /><a href=\"{{store url=\"\"}}\">Store Home</a> <span class=\"separator\">|</span> <a href=\"{{store url=\"customer/account\"}}\">My Account</a></li>\r\n</ul>\r\n</dd></dl>','2016-08-15 14:55:22','2016-08-15 18:37:11',1,0,NULL,NULL,NULL,NULL,NULL,NULL,'','','',0,0),(2,'Home page','one_column',NULL,NULL,'home',NULL,'<!-- -->','2016-08-15 14:55:22','2016-08-15 15:05:37',1,0,'<reference name=\"content\">\r\n  <block type=\"core/template\" name=\"homepage\" template=\"homepage/home.phtml\"/>\r\n</reference>',NULL,NULL,NULL,NULL,NULL,'','','',0,0),(3,'About Us','two_columns_left',NULL,NULL,'about-us',NULL,'<h2>MISSION</h2>\r\n<ul>\r\n<li>Educate everyone about the importance of food preparedness and why it is important to protect yourself and your family from life&rsquo;s unpredictable events.</li>\r\n<li>Provide a healthy storable product that tastes so good that you will want to eat it every day instead of just during times of duress.</li>\r\n<li>Improve peoples lives by providing access to this information and our products.</li>\r\n</ul>\r\n<h2>ABOUT NUMANNA</h2>\r\n<p>NuManna started out as small, home-based business in 2011,that through the vision of the founder, has evolved into a nationally trusted brand. By focusing on innovation, quality, taste, and our customers&rsquo; health, NuManna is able to provide food products that enable people to thrive during an emergency and not just survive. We offer the most innovative, nutritious, and sustainable food-preparedness solutions that you can find on the market today so that you can have the peace of mind that comes from knowing that you and your family are prepared for whatever surprises may come your way.</p>\r\n<p><iframe src=\"https://www.youtube.com/embed/SkV5sII7v9g\" height=\"480\" width=\"100%\"></iframe></p>\r\n<h2>ABOUT THE FOUNDER</h2>\r\n<p>Daniel Brigman, the Executive Director of NuManna, is a nationally recognized speaker, author, radio host and advocate for the Constitution and a return to the American way.</p>\r\n<p>Daniel grew up in a patriotic family near Atlanta, Georgia who valued the ideals of the founding fathers and created a drive in Daniel to learn more and do everything that he could to help people understand their rights and freedoms. Daniel has always felt passionate about educating others and while helping to write a political column in a Georgia newspaper, he had the opportunity to truly engage in personal study and reflection on some very important aspects of American history. This knowledge, coupled with his frustration with the country&rsquo;s current problems, inspired Daniel to write &ldquo;Forever 1776&rdquo;. His book explains the truth about the foundation of the United States of America in a clear and entertaining manner.</p>\r\n<p>This same type of drive and passion led Daniel on a quest to create the absolute best food preparedness product on the market today. NuManna was created by Daniel because he could not find a food storage product that satisfied the requirement of himself and his family. Because he could not find what he was looking for he started NuManna to provide a high quality food source for his own family and to educate people about their food preparedness options.</p>\r\n<h2>THE FOUNDATION</h2>\r\n<p>In lacinia ligula mi, et congue libero ultricies nec. Donec vel lacus nibh. Aenean posuere gravida ligula, nec vestibulum arcu lobortis id. Sed lacus felis, condimentum et lorem in, porta dictum neque. Nullam at lobortis diam. Maecenas faucibus fringilla sem, vitae auctor augue. Etiam dui nisi, posuere sed porta eget, fringilla id nisl.</p>','2016-08-15 14:55:22','2016-10-12 03:50:51',1,0,NULL,NULL,NULL,NULL,NULL,NULL,'','','',0,0),(4,'Customer Service','three_columns',NULL,NULL,'customer-service',NULL,'<div class=\"page-title\">\n<h1>Customer Service</h1>\n</div>\n<ul class=\"disc\">\n<li><a href=\"#answer1\">Shipping &amp; Delivery</a></li>\n<li><a href=\"#answer2\">Privacy &amp; Security</a></li>\n<li><a href=\"#answer3\">Returns &amp; Replacements</a></li>\n<li><a href=\"#answer4\">Ordering</a></li>\n<li><a href=\"#answer5\">Payment, Pricing &amp; Promotions</a></li>\n<li><a href=\"#answer6\">Viewing Orders</a></li>\n<li><a href=\"#answer7\">Updating Account Information</a></li>\n</ul>\n<dl>\n<dt id=\"answer1\">Shipping &amp; Delivery</dt>\n<dd>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobortis. Nulla nec velit.\nMauris pulvinar erat non massa. Suspendisse tortor turpis, porta nec, tempus vitae, iaculis semper, pede.\nCras vel libero id lectus rhoncus porta. Suspendisse convallis felis ac enim. Vivamus tortor nisl, lobortis in,\nfaucibus et, tempus at, dui. Nunc risus. Proin scelerisque augue. Nam ullamcorper. Phasellus id massa.\nPellentesque nisl. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas.\nNunc augue. Aenean sed justo non leo vehicula laoreet. Praesent ipsum libero, auctor ac, tempus nec, tempor nec,\njusto.</dd>\n<dt id=\"answer2\">Privacy &amp; Security</dt>\n<dd>Lorem ipsum dolor sit amet, consectetuer adipiscing elit. Morbi luctus. Duis lobo