arranties in relation to this website or the information and materials provided on this website.</p>\r\n<p>Without prejudice to the generality of the foregoing paragraph, www.NuManna.com does not warrant that:</p>\r\n<p>this website will be constantly available, or available at all; or</p>\r\n<p>Nothing on this website constitutes, or is meant to constitute, advice of any kind. If you require advice in relation to any legal, financial or medical matter you should consult an appropriate professional.</p>\r\n<h2>Limitations of liability</h2>\r\n<p>www.NuManna.com will not be liable to you (whether under the law of contact, the law of torts or otherwise) in relation to the contents of, or use of, or otherwise in connection with, this website:</p>\r\n<p>to the extent that the website is provided free-of-charge, for any direct loss;<br /> for any indirect, special or consequential loss; or<br /> for any business losses, loss of revenue, income, profits or anticipated savings, loss of contracts or business relationships, loss of reputation or goodwill, or loss or corruption of information or data.</p>\r\n<p>These limitations of liability apply even if www.NuManna.com has been expressly advised of the potential loss.</p>\r\n<h2>Exceptions</h2>\r\n<p>Nothing in this website disclaimer will exclude or limit any warranty implied by law that it would be unlawful to exclude or limit; and nothing in this website disclaimer will exclude or limit the liability of NuManna Foundation in respect of any:</p>\r\n<p>death or personal injury caused by the negligence of www.NuManna.com or its agents, employees or shareholders/owners;<br /> fraud or fraudulent misrepresentation on the part of www.NuManna.com; or<br /> matter which it would be illegal or unlawful for www.NuManna.com to exclude or limit, or to attempt or purport to exclude or limit, its liability.</p>\r\n<h2>Reasonableness</h2>\r\n<p>By using this website, you agree that the exclusions and limitations of liability set out in this website disclaimer are reasonable. If you do not think they are reasonable, you must not use this website.</p>\r\n<h2>Other parties</h2>\r\n<p>You accept that, as a limited liability entity, www.NuManna.comhas an interest in limiting the personal liability of its officers and employees. You agree that you will not bring any claim personally against www.NuManna.com&rsquo;s officers or employees in respect of any losses you suffer in connection with the website.</p>\r\n<p>Without prejudice to the foregoing paragraph, you agree that the limitations of warranties and liability set out in this website disclaimer will protect www.NuManna&rsquo;s officers, employees, agents, subsidiaries, successors, assigns and sub-contractors as well as www.NuManna.com.</p>\r\n<h2>Unenforceable provisions</h2>\r\n<p>If any provision of this website disclaimer is, or is found to be, unenforceable under applicable law, that will not affect the enforceability of the other provisions of this website disclaimer.</p>\r\n<h2>Indemnity</h2>\r\n<p>You hereby indemnify www.NuManna.com and undertake to keep www.NuManna.com indemnified against any losses, damages, costs, liabilities and expenses (including without limitation legal expenses and any amounts paid by www.NuManna.com to a third party in settlement of a claim or dispute on the advice of www.NuManna.com&rsquo;s legal advisers) incurred or suffered by www.NuManna.com arising out of any breach by you of any provision of these terms and conditions, or arising out of any claim that you have breached any provision of these terms and conditions.</p>\r\n<h2>Breaches of these terms and conditions</h2>\r\n<p>Without prejudice to www.NuManna.com&rsquo;s other rights under these terms and conditions, if you breach these terms and conditions in any way, www.NuManna.com may take such action as www.NuManna.com deems appropriate to deal with the breach, including suspending your access to the website, prohibiting you from accessing the website, blocking computers using your IP address from accessing the website, contacting your internet service provider to request that they block your access to the website and/or bringing court proceedings against you.</p>\r\n<h2>Variation</h2>\r\n<p>www.NuManna.com may revise these terms and conditions from time-to-time. Revised terms and conditions will apply to the use of this website from the date of the publication of the revised terms and conditions on this website. Please check this page regularly to ensure you are familiar with the current version.</p>\r\n<h2>Assignment</h2>\r\n<p>www.NuManna.com may transfer, sub-contract or otherwise deal with www.NuManna.com&rsquo;s rights and/or obligations under these terms and conditions without notifying you or obtaining your consent.</p>\r\n<p>You may not transfer, sub-contract or otherwise deal with your rights and/or obligations under these terms and conditions.</p>\r\n<h2>Severability</h2>\r\n<p>If a provision of these terms and conditions is determined by any court or other competent authority to be unlawful and/or unenforceable, the other provisions will continue in effect. If any unlawful and/or unenforceable provision would be lawful or enforceable if part of it were deleted, that part will be deemed to be deleted, and the rest of the provision will continue in effect.</p>\r\n<h2>Entire agreement</h2>\r\n<p>These terms and conditions, together with www.NuManna.com&rsquo;s Privacy Policy constitute the entire agreement between you and www.NuManna.com in relation to your use of this website, and supersede all previous agreements in respect of your use of this website.</p>\r\n<h2>Law and jurisdiction</h2>\r\n<p>These terms and conditions will be governed by and construed in accordance with the laws of _________________, and any disputes relating to these terms and conditions will be subject to the exclusive jurisdiction of the courts of __________________.</p>\r\n<h4>www.NuManna.com&rsquo;s details<br /> NuManna Foundation&rsquo;s registered address is:<br /> PO BOX 144<br /> Dexter, Missouri [63841]</h4>\r\n<p>You can contact NuManna by email at our email address link at the top of this Terms of Service document.</p>','2016-09-16 02:49:40','2016-10-13 03:06:38',1,0,NULL,NULL,NULL,NULL,NULL,NULL,'','','',0,0),(12,'Superfoods','one_column',NULL,NULL,'superfoods','Superfoods','<h2>What Are Superfoods?</h2>\r\n<p>During times of heightened stress, the body requires extra nutrition to repair itself and remain healthy.</p>\r\n<p>We boost the available nutrition of products that include our Defender Pack with organic grains and \"super foods\" (not synthetic vitamins, which are poorly absorbed and can be toxic.) Here are some examples of superfoods available in combos that include our <strong>Defender Pack:</strong></p>\r\n<h3>Organic quinoa</h3>\r\n<p>is considered one of the most nutritious foods in the world. It\'s the staple of many traditional cultures due to its extreme concentration of nutrients. Quinoa can be boiled, is gluten free, and it can be ground into flour. It mixes well with other foods. Quinoa is high in magnesium, manganese, iron, copper, phosphorous, complex proteins, and riboflavin.</p>\r\n<h3>Organic black chia seeds</h3>\r\n<p>sustained the Aztecs and Mayans, who considered it a survival food. It\'s been said that one tablespoon could sustain a warrior for a whole day. Organic black chia seeds are high in Omega-3 fatty acids, which are critical to heart health, and antioxidants, which protect the body from cellular damage. They can be stored for long periods without spoiling. Unlike flax, chia seeds don\'t need to be ground to release their nutrients. They\'re a superior source of fiber, calcium, phosphorus, magnesium, manganese, copper, iron, molybdenum, niacin, and zinc.</p>\r\n<h3>Organic sprouted seeds</h3>\r\n<p>Sprouting removes anti nutrients that inhibit your body\'s absorption. Like chia seeds, a spoonful of sprouted seeds is enough to suffuse your body with nutrition. Seeds are nature\'s own perfect packaging, so, they store very well. While all foods are subject to some nutrient loss, sprouting can increase their bioavailability, which means nutrients are converted into an active form that your body can use to maintain health and wellness.</p>\r\n<h3>Organic brown jasmine rice</h3>\r\n<p>Brown rice retains the outer bran and germ, which are rich in vitamins, minerals, fiber and essential fatty acids. Brown rice is rich in manganese, and the oil found in brown-rice bran has also been shown lower harmful cholesterol.</p>\r\n<h3>Parboiled rice</h3>\r\n<p>Because it is already partially cooked, it\'s extremely easy to prepare. The Defender Pack includes parboiled rice as a fast and extremely flexible staple to mix with existing meals to increase calorie count, nutrition and overall servings. Parboiled Rice is an important addition to your overall preparedness because it helps ensure adequate caloric intake.</p>\r\n<h3>Organic spelt</h3>\r\n<p>is one of the first grains to be used to make bread, which is the \"staff of life.\" Spelt (a close relative of wheat) has been a global staple food since the beginning of recorded history. It provides a broader range of nutrients than wheat, including manganese, vitamin B2, niacin, thiamin and copper. Spelt is particularly heart-healthy and cardio protective. It can reduce harmful cholesterol and is more digestible than wheat. Spelt can be great addition to an overall well-rounded and healthy natural diet.</p>','2016-09-17 03:14:35','2016-09-20 23:43:41',1,0,NULL,NULL,NULL,NULL,NULL,NULL,'','','',0,0),(13,'What We Avoid','one_column',NULL,NULL,'what-we-avoid','What We Avoid','<p>If you regularly check labels, and are concerned about GMO and food additives, you&rsquo;re not alone. Americans have become, party due to the powerful research capabilities of the Internet, more conscious about our food&rsquo;s ingredients than ever before. NuManna was founded on the principals of emergency preparedness based on wholesome foods that will sustain your family&rsquo;s long-term health in an emergency.</p>\r\n<h2>GMO Free</h2>\r\n<p>The controversy over genetically-altered foods is just getting started. Initial research has created more questions than answers. Because GMO is already part of tje foods is our supermarkets, and because there haven&rsquo;t been decades-long clinical trials, the American people have become, in effect, guinea pigs for GMO companies. But, you can opt out. NuManna foods are certified 100% GMO Free. We do our own DNA testing to double-verify all of our supplier&rsquo;s claims. It&rsquo;s that important to us. If it has the NuManna name on the package, you can be sure it&rsquo;s GMO free &ndash; for your long-term health.</p>\r\n<h2>No Aspartame</h2>\r\n<p>Aspartame is often used as a sugar substitute. NuManna has chosen to opt out of this trend. Research and studies have shown massive side effects, including headaches, dizziness, digestive problems, diabetes, and other very serious health conditions. Needless to say, these are not the kinds of experiences we&rsquo;d want to subject our families to. We&rsquo;ve chosen to ban any Aspertame (which goes by many names) as an ingredient in any of NuManna&rsquo;s products.</p>\r\n<h2>No High Fructose Corn Syrup</h2>\r\n<p>Because of the excessive chemicals sprayed on GMO crops High Fructose Corn Syrup has shown traces of mercury in them. It has been shown to be very hard on the pancreas and especially hard for small children to process and utilize.</p>\r\n<h2>No MSG</h2>\r\n<p>Because of the FDA&rsquo;s definition of mono-sodium, it is increasing difficult to label foods NO MSG. If a recipe has cheese or tomatoes in it then, according to the FDA, you cannot say it is MSG Free.</p>\r\n<p>What we can promise is this:</p>\r\n<p>You will not see added chemical MSG in our ingredient lists.</p>\r\n<h2>No Chemical Preservatives</h2>\r\n<p>There is a lot of science and art that goes into making a recipe store well without using chemicals to stabilize it. NuManna uses master blenders who have combined specific ingredients in a way to ensure quality over time. The packaging is of the highest standards. 5 mil over-engineered bags keep out any oxygen or light and the oxygen absorbers in the bag ensure the recipes are extremely well cared for. Add some Sea Salt and our food will stand the test of time.</p>\r\n<h2>No Soy</h2>\r\n<p>Because of estrogen mimickers and hormone manipulation concerns Soy is something some want to avoid. Combine these concerns with the allergies associated with Soy and it is just an ingredient we didn&rsquo;t want to put into NuManna. You also won&rsquo;t find any &ldquo;plastic meat&rdquo; like TVP or other Soy derived meat-like ingredients. NuManna meals are Soy Free.</p>','2016-09-17 03:14:58','2016-09-21 00:20:22',1,0,NULL,NULL,NULL,NULL,NULL,NULL,'','','',0,0),(14,'Sample Pack','one_column',NULL,NULL,'sample-pack',NULL,'<!-- -->','2016-09-18 04:33:53','2016-09-18 04:33:53',1,0,'<reference name=\"content\">\r\n  <block type=\"core/template\" name=\"samplepack\" template=\"samplepack/sample-pack.phtml\"/>\r\n</reference>',NULL,NULL,NULL,NULL,NULL,'','','',0,0),(15,'Testimonials','two_columns_left',NULL,NULL,'testimonials','Customer Testimonials','<!-- -->','2016-09-22 23:16:07','2016-09-22 23:34:12',1,0,'<reference name=\"content\">\r\n  <block type=\"core/template\" name=\"testimonials\" template=\"testimonials/testimonials.phtml\"/>\r\n</reference>',NULL,NULL,NULL,NULL,NULL,'','','',0,0),(16,'NuManna Products','one_column',NULL,NULL,'products-special','NuManna Products','<!-- -->','2016-10-12 01:33:49','2016-10-12 23:48:32',1,0,'<reference name=\"content\">\r\n  <block type=\"core/template\" name=\"products\" template=\"categories/categories.phtml\"/>\r\n</reference>',NULL,NULL,NULL,NULL,NULL,'','','',0,0),(17,'Refund Policy','two_columns_left',NULL,NULL,'refund-policy','Refund Policy','<p>Lorem ipsum dolor sit amet, consectetur 