INSERT INTO `widget_instance` VALUES (1,'qla/hpblock','numanna/default','Home page middle block #1','0','a:6:{s:5:\"title\";s:39:\"Bio-Available Nutrition During a Crisis\";s:4:\"text\";s:39:\"Bio-Available Nutrition During a Crisis\";s:5:\"image\";s:23:\"wysiwyg/HomePage/p1.png\";s:7:\"content\";s:338:\"During times of heightened stress, the body requires extra nutrition to repair itself and remain healthy. Each Defender Pack comes with 124 servings of our traditional GMO-free, easy-to prepare meals. In addition, we boost the available nutrition with \"super foods\" (not synthetic vitamins, which are poorly absorbed and can be toxic). \r\n\";s:10:\"link_title\";s:16:\"More information\";s:9:\"link_href\";s:46:\"http://numanna.transformagency.com/superfoods/\";}',0),(2,'qla/hpblock','numanna/default','Home page middle block #2','0','a:6:{s:5:\"title\";s:13:\"What We Avoid\";s:4:\"text\";s:13:\"What We Avoid\";s:5:\"image\";s:23:\"wysiwyg/HomePage/p2.png\";s:7:\"content\";s:275:\"<p>Numanna was formed on the principals of emergency preparedness as well as sustaining your family’s long-term health. </p>\r\n<ul>\r\n<li>GMO free</li>\r\n<li>No Aspartame or high-fructose corn syrup</li>\r\n<li>No added MSG:</li>\r\n<li>No chemical preservatives or soy</li>\r\n<ul>\";s:10:\"link_title\";s:16:\"More information\";s:9:\"link_href\";s:49:\"http://numanna.transformagency.com/what-we-avoid/\";}',0),(3,'qla/hpblock','numanna/default','Home page middle block #3','0','a:6:{s:5:\"title\";s:21:\"Superfood Ingredients\";s:4:\"text\";s:21:\"Superfood Ingredients\";s:5:\"image\";s:23:\"wysiwyg/HomePage/p3.png\";s:7:\"content\";s:244:\"<p>Superfood ingredients include: </p>\r\n<ul>\r\n<li>Organic quinoa</li>\r\n<li>Organic black chia seeds </li>\r\n<li>Organic sprouted seeds</li>\r\n<li>Organic brown jasmine rice</li>\r\n<li>Parboiled rice</li>\r\n<li>Organic spelt, and others </li>\r\n</ul>\";s:10:\"link_title\";s:16:\"More information\";s:9:\"link_href\";s:12:\"/ingredients\";}',0),(4,'numana/testimonialblock','numanna/default','Testimonials','0','a:5:{s:5:\"title\";s:19:\"Client Testimonials\";s:4:\"text\";s:281:\"\"I have tried several different brands of storable foods and NuManna has been the best. The food looks like actual food. Although it was difficult to pick a favorite as all are delicious...makes my mouth salivate just typing about it! Thank you NuManna for making incredible food!\"\";s:6:\"author\";s:12:\"Jayme, Texas\";s:10:\"link_title\";s:22:\"View more testimonials\";s:9:\"link_href\";s:13:\"testimonials/\";}',0);
